// JSON
import tasks from './tasks.json';
// css
import './App.css';

class App extends Component {
  state = {
    tasks: tasks
  }

  render(){
    return(
      <div className="App">
        <h1>Hola mundo</h1>
      </div>
    );
  }
}


export default App;
